import React from 'react';
import MoviePoster from './MovePoster/MoviePoster';
import classes from './MoviePosters.module.css';

const moviePosters = props => {
    const movies = props.movies.map(movie => 
         <MoviePoster title={movie} src='https://upload.wikimedia.org/wikipedia/en/f/f9/TheAvengers2012Poster.jpg'/>
    );
    return(
        <div className={classes.MoviePosters}>
            {movies}
        </div>
    );
};

export default moviePosters;
